    salinity and other variables collected from discrete sample and profile observations
    using CTD, bottle and other instruments from the KNORR, MAURICE EWING and others
    in the Andaman Sea or Burma Sea, Arabian Sea and others from 1983-10-10 to 1998-10-20
    (NODC Accession 0115689)",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-09-27T01:53:51.720882",nt"name": "dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-dbe17a",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0115689 includes chemical,
    discrete sample, physical and profile data collected from KNORR, MAURICE EWING,
    METEOR, NATHANIEL B. PALMER and THOMAS G. THOMPSON in the Andaman Sea or Burma Sea,
    Arabian Sea, Bay of Bengal, Bering Sea, Coral Sea, Gulf of Alaska, Indian Ocean,
    Laccadive Sea, North Atlantic Ocean, North Greenland Sea, North Pacific Ocean, Norwegian
    Sea, South Atlantic Ocean, South Pacific Ocean and Tasman Sea from 1983-10-10 to
    1998-10-20 and retrieved during cruise Keeling Shore Based Data. These data include
    ALKALINITY, Calcium, DELTA CARBON-13, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
    NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, Nickel, PHOSPHATE,
    SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect these
    data include CTD and bottle. These data were collected by Charles D. Keeling and
    Peter Guenther of Scripps Institution of Oceanography as part of the Keeling Shore
    Based Carbon Analyses data set.nnThe World Ocean Circulation Experiment (WOCE) was
    a major component of the World Climate Research Program with the overall goal of
    better understanding the ocean's role in climate and climatic changes resulting
    from both natural and anthropogenic causes. The CO2 survey took advantage of the
    sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
    this period between 1990 and 1998. The final collection covers approximately 23,000
    stations from 94 WOCE cruises.",nt"license_title": null,nt"extras": [{ntt"key":
